<H1><A NAME="prf1465"></A><SUP></SUP>Profiler Error PRF1465</H1>

<P class=dt><B>fatal error -- PREP II -- CPU type in PBT or PBO file filename conflicts with current one</B></P>

<P>Occurs only during PREP merging. The CPU type does not match the CPU type used to generate the incoming PBT or PBO files. All profiler steps must be run on the same type of computer.</P>
